import './App.css';
import alphabets from 'alphabets';
function App() {
  return (
    <div className="App">
      <div id="drum-machine">
        <div id="display">

        </div>
        <div className="drum-pad">
          <button>Q</button>
          <button>W</button>
          <button>E</button>
          <button>A</button>
          <button>S</button>
          <button>D</button>
          <button>Z</button>
          <button>X</button>
          <button>C</button>
        </div>
      </div>
    </div>
  );
}

export default App;
